import React, { Component } from 'react';
import MultiseriesChart from './Multiseries Chart';
import './style.css'

class Container extends Component {
  render() {    
    return (
      <div className="containerDiv">
	    <MultiseriesChart/>
      </div>
    );
  }
}

export default Container;
